// Inside your App.js

// ...

const calculateValues = (cartItems, discountCodes, totalDiscountAmount) => {
  const totalProducts = cartItems.length;
  const totalCost = cartItems.reduce((total, item) => total + item.price, 0);
  const discountApplied = discountCodes.length;
  const discountedPrice = totalCost - totalDiscountAmount;
  return {
    totalProducts,
    totalCost,
    discountApplied,
    discountedPrice,
  };
};

